Cheers to the fam and many Blessings! 
@sams_1531 
@alessandrasams102015

I’m so excited to be a part of two amazing events this weekend! On May 13th, I’m headed to Baldwin Park, CA for the Mental Health Awareness Walk/Run, hosted by @oath_to_country_foundation and the city of Baldwin Park. Then, on May 20th, I’m going to the Ladies Charity Flag Football tournament in Yucaipa, CA for Local Law Enforcement. Come out to one of these events and don’t forget to look for the black flag waving high!!
Much love to @Rifle Supply for letting us attend their Coffee and Cars Event last Sunday, I’m already looking forward to the next one Fam!
